angular.module("MyApp").controller("LoginCtrl",["$scope","Auth",function(o,l){o.facebookLogin=function(){l.facebookLogin()},o.pageClass="fadeZoom",$(".open-modal").click(function(){$(".login-box-block").hide();for(var o=$(this)[0],l=o.className.split(/\s+/),a=0;a<l.length;a++)if(l[a].match(/modal-/)){var c=l[a];$(".modal."+c).fadeIn("fast")}}),$(".close-modal").click(function(){$(".login-box-block").show(),$(this).closest(".modal").fadeOut("fast")})}]);